import React from 'react'
import '../components/CSS/Rotate.css'
const Imgrotate = () => {
  return (
    <div className='circle'>
      <div className='logo'>
      <img src="./Images/cv.jpg" className="logo" alt="pc" />
      </div>
      <div className='text'><p>shubham chikhale-react web developer-</p></div>
    </div>
  )
}

export default Imgrotate
